import React from "react";

// Exemple de données pour les agents IA avec des images en plus haute résolution
const agentsData = [
  {
    id: 1,
    name: "Agent Alpha",
    image: "https://via.placeholder.com/300x200?text=Alpha",
  },
  {
    id: 2,
    name: "Agent Beta",
    image: "https://via.placeholder.com/300x200?text=Beta",
  },
  {
    id: 3,
    name: "Agent Gamma",
    image: "https://via.placeholder.com/300x200?text=Gamma",
  },
  {
    id: 4,
    name: "Agent Delta",
    image: "https://via.placeholder.com/300x200?text=Delta",
  },
  {
    id: 5,
    name: "Agent Epsilon",
    image: "https://via.placeholder.com/300x200?text=Epsilon",
  },
  {
    id: 6,
    name: "Agent Zeta",
    image: "https://via.placeholder.com/300x200?text=Zeta",
  },
  {
    id: 7,
    name: "Agent Eta",
    image: "https://via.placeholder.com/300x200?text=Eta",
  },
  {
    id: 8,
    name: "Agent Theta",
    image: "https://via.placeholder.com/300x200?text=Theta",
  },
  {
    id: 9,
    name: "Agent Iota",
    image: "https://via.placeholder.com/300x200?text=Iota",
  },
];

function AIAgents() {
  // Le container occupe 90% de la largeur de la page pour un rendu large
  const containerStyle = {
    width: "90%",
    margin: "0 auto",
    padding: "20px",
  };

  // La grille est configurée pour afficher 3 agents par ligne avec un espace de 20px entre chaque carte
  const gridStyle = {
    display: "grid",
    gridTemplateColumns: "repeat(3, 1fr)",
    gap: "20px",
    marginTop: "20px",
  };

  const cardStyle = {
    backgroundColor: "#f9f9f9",
    padding: "15px",
    borderRadius: "8px",
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.1)",
  };

  // L'image occupe toute la largeur de sa carte et s'adapte pour conserver ses proportions
  const imageStyle = {
    width: "100%",
    height: "auto",
    borderRadius: "4px",
  };

  const nameStyle = {
    marginTop: "10px",
    fontSize: "1.2rem",
    fontWeight: "bold",
  };

  return (
    <div style={containerStyle}>
      <h1 style={{ textAlign: "center" }}>Catalogue des Agents IA</h1>
      <div style={gridStyle}>
        {agentsData.map((agent) => (
          <div key={agent.id} style={cardStyle}>
            <img src={agent.image} alt={agent.name} style={imageStyle} />
            <div style={nameStyle}>{agent.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AIAgents;
